import React from "react";
import * as S from './App.styles';  // Ajuste o caminho conforme necessário
import HeaderLogin from "./components/HeaderLogin";
import FormsLogin from "./components/FormsLogin";
import FormsRegister from "./components/FormsRegister";

const LoginPage = () => {
    return (
        <div>
            <S.HeaderLogin>
                <S.Title>Iphones do Nairobi</S.Title>
                <S.Subtitle>
                    <i className="pi pi-lock" style={{ color: 'white', fontSize: '1.5rem' }}></i>
                    100% Seguro
                </S.Subtitle>
            </S.HeaderLogin>
            <S.FormsContainer>
                <FormsLogin />
                <FormsRegister />
            </S.FormsContainer>
        </div>
    );
}

export default LoginPage;
